(2345, 'Hunain Siddique', 'hunainghayas.786@gmail.com', '0327 2158230', 'ar-vr-app-development', 'None', 'Request to visit appsnation Karachi.', 'Assalam o alaikum,\r\nHope you are doing well. My name is Hunain Siddique and I am a student at SZABIST studying software engineering. I want to make game development my career and for that I wanted some insight from the people who have experience in this field, so, I wanted to request you to please allow me to visit your company and help me learn from about this field more.\r\nKindly accept my request, I\'ll be grateful for that. \r\n\r\nThank you,\r\nBest regards\r\nHunain Siddique', '2024-08-09 01:24:13', '2024-08-09 01:24:13'),
(2358, 'shoaib iqbal', 'contact@devtolaravel.com', '03499206614', 'web-portal-development', 'Gomal Themes', 'Full stack Laravel/Vue Developer', 'Full stack Laravel/Vue Developer\r\n\r\nHello Sir/Madam,\r\n\r\nI trust this message finds you well.\r\n\r\nMy name is Shoaib, and I am a seasoned full stack web developer with a proven track record of delivering high-quality websites. I am writing to offer my services and provide a process-driven approach to ensure the success of your project. My commitment encompasses complete dedication, high-quality deliverables, long-term support, strong communication, and regular updates.\r\n\r\nHere is an overview of my expertise:\r\n\r\n* Proficiency in Laravel: Crafting robust and scalable backend solutions.\r\n* Expertise in Vue.js: Developing dynamic, responsive, and modern frontend interfaces.\r\n* HTML5, CSS3, SCSS, Bootstrap, Tailwind CSS, and Foundation: Mastery in these technologies to build responsive and visually appealing designs.\r\n* Modern JavaScript Frameworks: Experience with Vue Router and Vuex for efficient state management.\r\n* Design to Code Conversion: Seamlessly converting PSD/Sketch/AI designs into responsive Vue.js components.\r\n* API Integrations: Proficient in RESTful services and third-party API usage.\r\n* Single Page Applications: Extensive experience in developing SPAs with Vue.js.\r\n* Development Tools: Familiarity with NPM, Webpack, Gulp, and Git for streamlined development workflows.\r\n\r\nI also have good Experince in Worpress Custom theme and plugin development.\r\n\r\nFor a portfolio of my work, please visit http://devtolaravel.com/.\r\n\r\nI am dedicated to delivering exceptional results and maintaining clear communication throughout the project lifecycle to ensure your utmost satisfaction.\r\n\r\nThank you for considering my proposal. I look forward to the opportunity to contribute to the success of your organization.\r\n\r\nBest regards,', '2024-08-20 10:43:20', '2024-08-20 10:43:20'),
(2361, 'Maria Wilson', 'mariawilson.digitalmarketing@gmail.com', '5712007758', 'mobile-app-development', 'Digital Marketing Company', 'Get higher rankings on Google with SEO at a much lower Cost', 'Hi,\r\n\r\nWe have a team of 55+ highly qualified professionals certified in SEO and ISO standards, providing a wide range of SEO services to generate higher visitor traffic and top-page rankings for your website. Our SEO professionals ensure that your website gets higher rankings on Google. We offer SEO (with plan & activity) Services at much lower Cost. \r\n\r\nI\'d gladly send you our Package, Activity per Month, and Video Testimonials for reference.\r\n\r\nRegards,\r\nMaria', '2024-08-21 07:57:28', '2024-08-21 07:57:28'),
(2411, 'rashid ali', 'web.planet786@gmail.com', '03499206614', 'mobile-app-development', 'gomal theme', 'Full stack developer', 'I hope this message finds you well.\r\n\r\nI am reaching out to introduce myself as a highly skilled and experienced full stack web developer. With a proven track record of delivering top-notch websites, I offer a process-driven approach ensuring complete dedication to your project, high-quality deliverables, long-term commitment, strong communication, and regular updates.\r\n\r\nHere\'s a glimpse of what I offer:\r\n\r\n- Proficiency in Core PHP, Laravel, and WordPress Custom Development\r\n- Expertise in Clickfunnel, Lightspeed, Go-High Level, and various other platforms\r\n- Mastery in HTML5, CSS3, SCSS, Bootstrap, Tailwind CSS, and Foundation\r\n- Experience with NPM, Gulp, SCSS, and JavaScript/jQuery\r\n- Ability to seamlessly convert PSD/Sketch/AI designs into HTML/WordPress\r\n- Proficient in API Integrations, E-commerce Solutions (including WooCommerce), and Git/Bitbucket\r\n- Extensive experience in WordPress Theme and Plugin Development\r\n\r\nYou can view some of my work samples at  http://rashidev.com/ .\r\n\r\nI am committed to delivering high-quality results, maintaining strong communication throughout the project lifecycle, and providing regular updates to ensure your utmost satisfaction.\r\n\r\nI am eager for the opportunity to leverage my skills and experience to contribute to the success of your organization. Thank you for considering my proposal.\r\n\r\nBest Regards,', '2024-09-30 07:55:02', '2024-09-30 07:55:02'),
