(3056, 'Martinked', 'mtskhetag@gmail.com', '81548756112', '-', '-', 'Mobile Balancing System Balanset-1A', 'Dear Colleagues! \r\nWe are pleased to offer modern equipment for imbalance elimination of rotating mechanisms - portable balancing device Balanset-1A. \r\nOfficial product page: https://vibromera.eu/shop/889/ \r\n<a href=\"https://vibromera.eu/shop/889/\"><img src=\"https://vibromera.eu/wp-content/uploads/2025/05/12.webp\" alt=\"Full balancing system\" style=\"max-width: 100%; height: auto; margin: 20px 0;\"></a> \r\n \r\nWhere It\'s Applied \r\nBalanset-1A is actively applied for vibration adjustment of various types rotating mechanisms: \r\nProduction Mechanisms: \r\nVentilation Systems - industrial, centrifugal, axial. Pump Units - centrifugal, chemical. Electric Motors - DC motors. Turbo Units - steam. Compression Equipment - piston. \r\nProcessing Equipment: \r\nTool Spindles - lathe. Grinding Wheels. Roll Equipment of rolling mills. \r\nAgricultural Machinery: \r\nChoppers. Rotary Mowers. Crushers for fertilizers. \r\nSpecialized Machinery: \r\nCentrifugal Equipment - laboratory. Air Blowers. Milling Units. Drive Shafts. \r\n<a href=\"https://vibromera.eu/shop/889/\"><img src=\"https://vibromera.eu/wp-content/uploads/2024/04/1714073479045.jpg\" alt=\"Field balancing on combine harvester\" style=\"max-width: 100%; height: auto; margin: 20px 0;\"></a> \r\n \r\nTechnical Parameters \r\nKey Characteristics: \r\nBalancing planes: One or two. Rotation frequency range: 200 to 15,000 revolutions per minute. Phase error: Â±1Â°. Vibration measurement accuracy: Â±5%. Measurement channels: 2. Measured vibration velocity: 0.1 to 300 mm/s. Power supply: From computer USB port. Equipment mass: 4 kg. \r\nFunctional Capabilities: \r\nAutomatic calculation of balancing weights. Database of operations. Tolerance calculation according to ISO 1940. FFT analysis of vibration. Data visualization in real time. Split-weight calculator. Index balancing of mandrels. \r\n \r\nDeli