(3063, 'WalterChoks', 'walter@gmail.com', '84513762332', '-', '-', 'Mobile Balancing System Balanset-1A', 'Greetings! \r\nWe are pleased to offer high-tech solution for dynamic balancing of rotating equipment - portable balancing device Balanset-1A. \r\nOfficial product page: https://vibromera.eu/shop/889/ \r\n<a href=\"https://vibromera.eu/shop/889/\"><img src=\"https://vibromera.eu/wp-content/uploads/2025/05/12.webp\" alt=\"Full balancing system\" style=\"max-width: 100%; height: auto; margin: 20px 0;\"></a> \r\n \r\nWhere It\'s Applied \r\nBalanset-1A is widely used for balancing of various types rotating equipment: \r\nIndustrial Machinery: \r\nVentilation Units - manufacturing, centrifugal, duct. Pumping Equipment - gear, chemical. Electromotors - asynchronous. Turbo Units - gas. Compressors - centrifugal. \r\nProcessing Equipment: \r\nTool Spindles - grinding. Grinding Discs. Roll Mechanisms of textile equipment. \r\nAgro Equipment: \r\nCombine Rotors. Rotary Mowers. Crushers for fertilizers. \r\nSpecial Equipment: \r\nCentrifugal Equipment - laboratory. Air Blowers. Mills. Cardan Shafts. \r\n<a href=\"https://vibromera.eu/shop/889/\"><img src=\"https://vibromera.eu/wp-content/uploads/2025/03/Screenshot-2025-03-06-012053.png\" alt=\"Agricultural machinery diagnostics\" style=\"max-width: 100%; height: auto; margin: 20px 0;\"></a> \r\n \r\nTechnical Parameters \r\nKey Characteristics: \r\nBalancing planes: One or two. Operating speed range: 200 to 15,000 rpm. Phase determination accuracy: Â±1Â°. Vibration measurement precision: Â±5%. Measurement channels: 2. Vibration measurement limits: 0.1 to 300 mm/s. Power supply: From computer USB port. Equipment mass: 4 kg. \r\nFunctional Capabilities: \r\nAutomated computation of correction masses. Results archiving of operations. Standards determination according to ISO 1940. FFT analysis of vibration. Graphics in diagram form. Correction mass distribution. Eccentricity compensation of mandrels. \r\n \r\nSupply Composit