INSERT INTO `portfolios` (`id`, `icon`, `image`, `title`, `content`, `bullet_1`, `bullet_2`, `bullet_3`, `bullet_4`, `type`, `is_show`, `order_by`, `comments`, `parent_id`, `lft`, `rgt`, `depth`, `created_at`, `updated_at`) VALUES
(22, 'portfolio/3e0726d615f98b3de91fef95eb29af64.webp', 'portfolio/c5419f85ed56928dd55d3a52e56fc712.webp', 'Travel Agency App', 'Travelicious stands out as the ultimate travel planning tool, designed to cater to the diverse needs of modern travelers. From booking flights and accommodations to discovering local attractions and hidden gems, Travelicious simplifies every step of your journey. Our commitment to user experience excellence ensures that every interaction with the app is intuitive, efficient, and tailored to enhance your travel experience. With Travelicious, travel planning becomes not just a task but an enjoyable part of your adventure.', 'Booking', 'Promotions & Discounts', 'Payment Gateways', 'Mortgage', 'Mobile', 1, NULL, 'case-studies/travel-agency-app', NULL, 26, 27, 1, '2024-05-21 14:18:25', '2025-12-08 15:55:50'),
(23, 'portfolio/2c935013aad64dd3a08c6eb825a904b4.webp', 'portfolio/f1cffb42df6929af87b6abd974a96889.webp', 'Travel Agency Web', 'Introducing Travelicious, your ultimate travel web for seamless planning and unforgettable adventures. From personalized recommendations tailored to your preferences, to easy booking and exclusive deals, Travelicious ensures that every journey is hassle-free and filled with excitement. Explore with confidence and discover new horizons with Travelicious by your side. Start your next travel experience today and transform the way you explore the world.', 'Dashboard', 'Content Management', 'User Management', 'Service Management', 'Web', 0, NULL, 'case-studies/travel-agency-web', NULL, 24, 25, 1, '2024-05-21 14:54:25', '2025-12-08 15:55:50'),
(24, 'portfolio/2a4f9755820fcefc35bd00768574e304.webp', 'portfolio/aa62815704501c87dae7394581422a4b.webp', 'Real Estate App', 'Discover a simpler way to navigate real estate with our mobile app, designed to streamline the buying, selling, and renting process. Our app combines detailed property listings, a convenient mortgage calculator, and map integration into a user-friendly interface that makes real estate decisions easier and more accessible. Explore the features that set us apart and enhance your property search experience.', 'Search Properties', 'Property Information', 'Map Integration', 'Payment Gateways', 'Mobile', 0, NULL, 'case-studies/real-estate-app', NULL, 22, 23, 1, '2024-06-03 14:36:02', '2025-12-08 15:55:50'),
(25, 'portfolio/eb1a6061c3f8d0e15e2c3a214e7dec40.webp', 'portfolio/a9f1a1ddc85a019623dda2d32c1c008f.webp', 'Real Estate Web', 'Avenue Is The Best Application Which Provides A Complete Guide For Purchasing And Selling Of Properties. Discover Avenue, the premier app for effortless property transactions. With a user-friendly interface, comprehensive listings, and powerful tools, we make buying and selling properties straightforward and efficient. Join us and navigate the real estate market with confidence and ease.', 'Dashboard', 'Properties Management', 'Mortgage', 'User Management', 'Web', 0, NULL, 'case-studies/real-estate-web', NULL, 20, 21, 1, '2024-06-14 14:36:05', '2025-12-08 15:55:50'),
(26, 'portfolio/e54f8cf3254e38f44180aecc842ec9f5.webp', 'portfolio/1258c9448b2d92a3d019c9c857e1ee13.webp', 'Loyalty App', 'Discover a new level of shopping with Bonus Buddy. Enjoy exclusive cashback rewards, personalized deals, and a seamless experience across your favorite e-commerce platforms. Our intuitive app ensures you never miss out on the best offers tailored just for you, making your shopping journey more enjoyable and efficient. Easily track your rewards and savings in real-time, browse curated recommendations that match your preferences, and unlock special bonuses with every purchase. Share your favorite finds with friends and join a community of savvy shoppers who value smart spending and great deals. Shop smarter, save more, and make every purchase rewarding. Welcome to a superior shopping journey with Bonus Buddy, where your loyalty is always appreciated and rewarded!', 'Promotional Offers', 'Rewards', 'Discounts', 'Earn & Redeem Points', 'Mobile', 0, NULL, 'case-studies/loyalty-app', NULL, 18, 19, 1, '2024-06-24 15:36:47', '2025-12-08 15:55:50'),
(27, 'portfolio/bc40d0c0a0b1167b8b5ae7d6d99f87bb.webp', 'portfolio/449c1de84565c2dba2e3a7d96260766b.webp', 'Loyalty Web', 'Bonus Buddy goes beyond just offering cashback deals; it\'s about building a trusted relationship with our users. Our commitment to excellence is reflected in every aspect of the app, from the intuitive interface that simplifies your shopping journey to the robust security measures safeguarding your transactions. Experience peace of mind as you shop with Bonus Buddy, knowing that we\'re dedicated to providing you with a seamless, rewarding, and secure experience every time you use our app. Join Bonus Buddy today and discover a new level of convenience and savings in your shopping endeavors.', 'Dashboard', 'Content Management', 'Promotions', 'Reviews', 'Web', 0, NULL, 'case-studies/loyalty-web', NULL, 16, 17, 1, '2024-06-24 15:40:32', '2025-12-08 15:55:50'),
(28, 'portfolio/3d43adb4ff31b40211d4241474705c85.webp', 'portfolio/0872333c7b48a24b4e6b15d2e4fa26e3.webp', 'Gym App', 'More than just a fitness app, Gymnasium acts as your personal trainer, nutritionist, and motivational coachâ€”all conveniently housed within a user-friendly interface. We understand that starting and sticking to a fitness regimen can be challenging, which is why Gymnasium simplifies the complexities of fitness, making it accessible and enjoyable for everyone, anywhere, and anytime. From personalized workout plans tailored to your fitness level and goals to expert dietary recommendations, Gymnasium empowers you to take charge of your health with confidence and ease.', 'Management of Profile', 'Management of Timeline', 'Meal Plan', 'View Recipes', 'Mobile', 0, NULL, 'case-studies/gym-app', NULL, 14, 15, 1, '2024-07-04 03:52:15', '2025-12-08 15:55:50'),
